import { BreedFilter } from "./BreedFilter";
import { OriginFilter } from "./OriginFilters";
import { OrderWeight } from "./OrderWeight";
import { FilterTemps } from "./FilterTemps";

export function AllFiltersButtos() {
    return (
        <>
           
            <ul class="nav nav-pills nav-fill">
                <li class="nav-item">
                    <FilterTemps class="nav-link active" aria-current="page" href="#" />
                </li>
                <li class="nav-item">
                <OriginFilter class="nav-link"/>
                </li>
                <li class="nav-item">
                <OrderWeight class="nav-link" href="#"/>
                </li>
                <li class="nav-item">
                <BreedFilter class="nav-link disabled"/>
                </li>
            </ul>
        </>
    )
}
